import React from 'react';
import { NAV } from '../../router/url';
import { Link } from 'react-router-dom';
import { withRouter } from "react-router";

function FooterNav (props) {
console.log(props.location.pathname);
    function renderNavItem (item) {
        return (
            <li className="nav-item active" key = {item.url}>
              <Link Link a className="nav-link" to ={item.url}>{item.title}</Link>
            </li>
        )
    }

    return (
                                <nav className="navbar navbar-expand-lg justify-content-end">
                                    <button classN="navbar-toggler collapsed" type="button" data-toggle="collapse" 
                                        data-target="#footerNavContent" aria-controls="footerNavContent" aria-expanded="false" 
                                        aria-label="Toggle navigation"><i class="fa fa-bars"/></button>
                                    <div class="navbar-collapse collapse" id="footerNavContent">
                                        <ul class="navbar-nav ml-auto">

                                           {
                                             NAV.map(renderNavItem)
                                           }


                                        </ul>
                                    </div>
                                </nav>
    )
}

export default withRouter(React.memo(FooterNav));
